@JuliaDavisNews Russia will try to shake America, as it does in Ukraine for decades.
But we are immune from Russian narratives already.

What about you, dear Americans?

@Zvjedavaa @sumlenny @polyglotme The war was won by the USSR as a whole, not just the Ukraine.

Think of the huge battles that took place in Russia: the siege of Leningrad, the gates of Moscow, Stalingrad, Kursk.

Writing Russia out of WWII is not only wrong, but an insult to millions who died to defeat Nazism.
